import { State, Action, StateContext, Selector } from '@ngxs/store';
import * as AppDataActions from './app-data.actions';
import { Injectable } from '@angular/core';
import { AppData } from '@shared/models/app-data.model';
import { User } from '@shared/models/user.model';

export class AppDataStateModel {
  appData: AppData | undefined;
  loaded: boolean | undefined;
}

@State<AppDataStateModel>({
  name: 'appData',
  defaults: {
    appData: new AppData({} as User),
    loaded: false,
  },
})
@Injectable()
export class AppDataState {
  constructor() {}

  @Selector([AppDataState])
  static getAppData(state: AppDataStateModel): AppData | undefined {
    return state.appData;
  }

  @Action(AppDataActions.Delete)
  deleteDispute(
    ctx: StateContext<AppDataStateModel>,
    {}: AppDataActions.Delete
  ): void {
    const state = ctx.getState();
    const appData = new AppData({} as User);
    ctx.setState({
      ...state,
      appData,
    });
  }

  @Action(AppDataActions.Edit)
  updateDispute(
    ctx: StateContext<AppDataStateModel>,
    { payload }: AppDataActions.Edit
  ): void {
    const state = ctx.getState();
    const appData = {
      ...state,
      ...payload,
    };
    ctx.patchState({
      appData,
    });
  }

  @Action(AppDataActions.Add)
  addDispute(
    ctx: StateContext<AppDataStateModel>,
    { payload }: AppDataActions.Add
  ): void {
    const state = ctx.getState();
    const appData = payload;
    ctx.setState({
      ...state,
      appData,
    });
  }
}

import { Injectable } from '@angular/core';
import Auth, { CognitoHostedUIIdentityProvider } from '@aws-amplify/auth';
import { Hub, ICredentials } from '@aws-amplify/core';
import { Subject, Observable } from 'rxjs';
import { CognitoUser, ISignUpResult } from 'amazon-cognito-identity-js';
import { Store } from '@ngxs/store';
import * as AppDataActions from '@store/app-data/app-data.actions';
import { AppData } from '@shared/models/app-data.model';
import { User } from '@shared/models/user.model';

export interface NewUser {
  username: string;
  password: string;
}

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  private authState: Subject<CognitoUser | any> = new Subject<
    CognitoUser | any
  >();
  authState$: Observable<CognitoUser | any> = this.authState.asObservable();

  public static SIGN_IN = 'signIn';
  public static SIGN_OUT = 'signOut';
  public static FACEBOOK = CognitoHostedUIIdentityProvider.Facebook;
  public static GOOGLE = CognitoHostedUIIdentityProvider.Google;

  constructor(private store: Store) {
    Hub.listen('auth', (data) => {
      const { channel, payload } = data;
      console.log('auth change', channel, payload);
      switch (payload.event) {
        case 'signIn':
          this.authState.next(payload.data);
          let user: CognitoUser = payload.data;
          let appData = new AppData(new User('abc', true));
          this.store.dispatch(new AppDataActions.Add(appData));
          break;
        case 'signOut':
          // handle sign out
          break;
        default:
          // do something by default
          break;
      }
    });
  }

  /**
   * Cognito sign up method
   * @param user
   * @returns
   */
  signUp(user: NewUser): Promise<ISignUpResult> {
    return Auth.signUp({
      username: user.username,
      password: user.password,
      attributes: {
        email: user.username,
      },
    });
  }

  /**
   * Cognito sign in method
   * @param username
   * @param password
   * @returns
   */
  signIn(username: string, password: string): Promise<CognitoUser | any> {
    return new Promise((resolve, reject) => {
      Auth.signIn(username, password)
        .then((user: CognitoUser | any) => {
          resolve(user);
        })
        .catch((error: any) => reject(error));
    });
  }

  /**
   * Simple sign out method
   * @returns
   */
  signOut(): Promise<any> {
    return Auth.signOut();
  }

  /**
   * Social signin (supports facebook and google)
   * @param provider
   * @returns
   */
  socialSignIn(
    provider: CognitoHostedUIIdentityProvider
  ): Promise<ICredentials> {
    return Auth.federatedSignIn({
      provider: provider,
    });
  }

  resendSignUp(email: string): Promise<string> | undefined {
    return email ? Auth.resendSignUp(email) : undefined;
  }

  forgotPasswordSubmit(
    email: string,
    code: string,
    pw: string
  ): Promise<void> | undefined {
    return email
      ? Auth.forgotPasswordSubmit(email.toLowerCase(), code, pw)
      : undefined;
  }

  async refreshAuthState(user?: CognitoUser): Promise<void> {
    if (user) {
      this.authState.next(user);
      return;
    }
    try {
      const user = await Auth.currentAuthenticatedUser();
      this.authState.next(user);
    } catch (err) {
      const unconfirmed = await Auth.currentCredentials();
      this.authState.next(null);
    }
  }

  async getAuthTokens(): Promise<string> {
    try {
      const user: CognitoUser = await Auth.currentAuthenticatedUser();
      let session = user.getSignInUserSession();
      return session ? session.getIdToken().getJwtToken() : '';
    } catch (err) {
      return '';
    }
  }

  getAuthState(): Observable<CognitoUser | any> {
    return this.authState$;
  }
}

