import {
  Component,
  ElementRef,
  EventEmitter,
  Input,
  OnInit,
  Output,
  ViewChild,
} from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { Subscription } from 'rxjs';

/**
 * For use within hidden code form.
 * Only works in a form.
 */
@Component({
  selector: 'brave-hidden-asterisk-input',
  templateUrl: './hidden-asterisk-input.component.html',
})
export class HiddenAsteriskInputComponent implements OnInit {
  @ViewChild('hiddenInput') hiddenInput: ElementRef | undefined;

  @Input() size: string = 'text-sm';
  @Input() index: number = 0;
  @Input() value: string = '';

  @Output() valueChanged: EventEmitter<any> = new EventEmitter();
  @Output() onMoveNext: EventEmitter<any> = new EventEmitter();
  @Output()
  onComponentReady: EventEmitter<FormGroup> = new EventEmitter<FormGroup>();

  private _masked: boolean = false;
  public componentFormGroup!: FormGroup;
  public formSub$: Subscription | undefined;

  get masked() {
    return this._masked;
  }
  set masked(value: boolean) {
    this._masked = value;
  }

  constructor(private fb: FormBuilder) {}

  ngOnInit(): void {
    this.componentFormGroup = this.fb.group({
      input: [this.value, Validators.required],
    });
    this.formSub$ = this.componentFormGroup.controls.input.valueChanges.subscribe(
      (value) => {
        this.valueChanged.emit(value);
        if (value?.length) this.onMoveNext.emit();
      }
    );
    this.onComponentReady.emit(this.componentFormGroup);
  }

  ngOnDestroy() {
    if (this.formSub$) this.formSub$.unsubscribe();
  }

  /**
   * Sets the focus to the hiddien input native element
   */
  focusMe() {
    const el: HTMLInputElement = this.hiddenInput?.nativeElement;
    if (el) el.focus();
  }

  /**
   * Removes any value stored in the input element
   */
  clearMe() {
    const el: HTMLInputElement = this.hiddenInput?.nativeElement;
    if (el) {
      el.value = '';
      el.click();
    }
  }
}

import {
  Component,
  OnInit,
  Input,
  Output,
  EventEmitter,
  OnDestroy,
  ViewChildren,
  QueryList,
} from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { HiddenAsteriskInputComponent } from '@shared/components/inputs/hidden-asterisk-input/hidden-asterisk-input.component';
import { Subscription } from 'rxjs';

@Component({
  selector: 'brave-hidden-code-form',
  templateUrl: './hidden-code-form.component.html',
})
export class HiddenCodeFormComponent implements OnInit {
  @ViewChildren(HiddenAsteriskInputComponent)
  hiddenFields: QueryList<HiddenAsteriskInputComponent> | undefined;

  parentFormGroup: FormGroup;
  childName: string = 'input';
  private _slots: number[] = [];
  private formSub$: Subscription | undefined;

  @Input()
  get slots() {
    return this._slots;
  }
  set slots(slots: number[]) {
    this._slots = slots;
  }

  @Output() valueChanged: EventEmitter<any> = new EventEmitter();
  @Output()
  onComponentReady: EventEmitter<FormGroup> = new EventEmitter<FormGroup>();

  constructor(private fb: FormBuilder) {
    this.parentFormGroup = fb.group({
      code: [''],
    }); // simple parent form with name of form
  }

  ngOnInit(): void {
    this.formSub$ = this.parentFormGroup.valueChanges.subscribe((values) => {
      this.valueChanged.emit(values);
    });
    this.onComponentReady.emit(this.parentFormGroup);
  }

  ngOnDestroy(): void {
    if (this.formSub$) this.formSub$.unsubscribe();
  }

  /**
   * Adds the digits to the parent form
   * @param childName
   * @param childGroup
   * @param digit
   */
  addChild(childName: string, childGroup: FormGroup, digit: number): void {
    this.parentFormGroup.addControl(`${childName}-${digit}`, childGroup);
  }

  /**
   * Moves to the component located at the index
   * @param idx
   */
  moveNext(idx: number): void {
    const comp = this.hiddenFields?.find((c) => c.index === idx + 1);
    if (comp) {
      setTimeout(() => {
        comp.focusMe();
      }, 500);
    }
  }

  /**
   * Clears out all the values from the form
   */
  clearForm(): void {
    this.hiddenFields?.forEach((c) => {
      c.clearMe();
    });
    this.hiddenFields?.first.focusMe(); // set the cursor to the first one
  }
}

